import React, { useContext } from 'react'
import { Link } from "react-router-dom";
import { ByteContext } from '../context/bytes';
import { Box } from '@material-ui/core/Box';

const Bytes = () => {
    const { bytes } = useContext(ByteContext);

    if (!bytes.length) {
        return <h3>No Bytes Available</h3>
    }

    return (
        <section className="bytes">
            {bytes.map(({ id, index, owner, content }) => (
                <article key={id} className="byte">
                    {owner === null &&
                      <div className="byte-presentation">
                        <h2>Bit {index}</h2>
                        <Link to={`${id}`} className="btn byte-link">details</Link>
                      </div>
                    }
                    {owner !== null &&
                      <Box component="span">
                        <h2>Bit {index}</h2>
                        <h4>{content}</h4>
                      </Box>
                    }
                </article>
            ))}
        </section>
    )
}

export default Bytes
